import logo from './logo.svg';
import './App.css';
import Customer from './components/Customer';

const customers =[
  {
    'id':1
    ,'image':'https://placeimg.com/64/64/1'
    ,'name':'조승진'
    ,'birthday':'960807'
    ,'gender':'남'
    ,'job':'대학생'
  },
  {
    'id':2
    ,'image':'https://placeimg.com/64/64/2'
    ,'name':'홍길동'
    ,'birthday':'960807'
    ,'gender':'남'
    ,'job':'대학생'
  },
  {
    'id':3
    ,'image':'https://placeimg.com/64/64/3'
    ,'name':'이순신'
    ,'birthday':'960807'
    ,'gender':'남'
    ,'job':'대학생'
  },
]


function App() {
  return ( 
    <div>
      {
        customers.map(c=>{
          return(<Customer
            id={c.id}
            image={c.image}
            name={c.name}
            gender={c.gender}
            job={c.job}
          />
          );
        })
      }
    </div>
  );
}

export default App;
